import React from "react";

const Projecteaturveg = () => {
    return (
        <div>
            <a href="https://iguannalin.github.io/eaturveg/Projecteaturveg.js">View Project</a>
            <h2>About this project</h2>
            <div className="about-project">
            <p>I started this project at a time when I was kindling a love for both vegetables and JSON. Unable to find
                a good source of information on vegetables that are in-season, I decided to scrape this data from the
                local CUESA website.</p>
            </div>
        </div>
    );
};

export default Projecteaturveg;
